        description:
          "Problem 1:\nGiven an unsorted array of positive integers with duplicates, and an integer k and a threshold integer.\nFind the minimum number of elements to be removed such that the sum of any k elements in the array does not exceeds the threshold.\n\nAttempted Approach:\nUsed sorting and subarray sum initially but didn't work out coz this does not treat the elements as subsequent. And then switched to a priority queue method to get the maximum subset sum and count how many subset sums are exceeding the threshold. This approach does not handle duplicates. The later one was partially accepted for 5 testcases. Not sure how to implement a backtrack solution.\n\nProblem 2:\nGiven an unsorted array of integers with duplicates and integer m and and integer k.\nFind the kth minimum element of all the contiguous subarray whose length is m.\n\nAttempted approach:\nUsed a min heap approach to pop the kth minimum element but got a TLE for lot of cases. Hence priority queue and sorting each of the sliding window subarray will be suboptimal. This points out the expected TC should be O(N). I tried using a deque approach. But this one is also paritially accepted.",
