        currency_type: null,
        tracked_obj: 'greenhouse:via/jobs/7505054002',
        visible: false,
        description:
          '<p><span>At Citymapper (powered by Via), we’re on a mission to help make complex cities more accessible to everyday users. Our application transports millions of people in hundreds of cities around the world by giving them access to the most current and sophisticated transportation options available.  We make getting around your favorite city easy, so that you can enjoy the ride.</span></p>\n<p><span>As a <strong>Transportation</strong> </span><strong>Data Analyst (French-speaking) </strong><span>at Citymapper,</span><span>you will be managing the data that is the backbone of our application’s success. Y</span><span>our work directly impacts our user experience, and is the difference between a user seeing a bus drive away, or reaching it just in time. Millions of users around the world trust our application to be on time for work, a job interview, or a date - and we take great responsibility in fulfilling that need.</span></p>\n<p><em><span>This job can be done remotely if you’re based in England, the Netherlands, Germany or Bulgaria. If you prefer hybrid, we have offices in London, Berlin, Paris, Amsterdam, and Sofia.</span></em></p>\n<p><strong>What You’ll Do:</strong></p>\n<ul>\n<li><span>You will help to manage the timetable data that powers the Citymapper application. Using proprietary tools and methods, you will transform often messy transit schedules into shiny and reliable user information. </span></li>\n<li><span>You will build, validate and ship data to production on a daily basis.</span></li>\n<li><span>You will manage data in a range of cities and across different formats. </span></li>\n<li><span>You will work with our engineers to build for scale by improving tools and automating tasks. </span></li>\n<li><span>You will ensure data quality in our web and mobile products so that users continue to love and trust Citymapper.</span></li>\n</ul>\n<p><strong>Who You Are:</strong></p>\n<ul>\n<li><span>You speak fluent French (C1-level or above)</span></li>\n<li><span>You have a passion for public transportation and cities, and an interest in how public transportation networks operate.</span></li>\n<li><span>You are comfortable dealing with large data sets, and have an eagerness to learn new data skills.</span></li>\n<li><span>You take a hands-on, practical, pragmatic attitude to your work.</span></li>\n<li><span>You have exceptional attention to detail, and an ability to communicate those details to other collaborators.</span></li>\n<li><span>You have up to 3 years of experience working with data, Python and/or common transit data formats (GTFS, TransXChange, Siri, Hafas, etc).</span></li>\n</ul>\n<div>\n<p><strong>What We Offer:</strong></p>\n<ul>\n<li>Becoming part of Via, a company that was awarded for its commitment to social good</li>\n<li>Joining the team working on the industry-leading mobile app that is loved and trusted by millions of users</li>\n<li>State of the art hardware for you to perform your work worry free</li>\n<li>Ongoing support and training to ensure you have the resources you need to thrive and progress in your career</li>\n<li>Competitive compensation</li>\n<li>Additional health insurance coverage</li>\n<li>Catered lunches at the office</li>\n<li>25 vacation days</li>\n</ul>\n<p><span>We’re Via, and we build technology that changes the way the world moves. We pioneered the TransitTech category to ensure that the future of transportation is shared, dynamic public mobility — the kind that reduces carbon emissions across congested cities, minimizes reliance on private cars, and provides </span><em><span>everyone</span></em><span> with accessible, efficient, and affordable ways of getting around. </span></p>\n<p><span>We created the first end-to-end TransitTech solution for cities and transit agencies, offering world-class software, service design, and operational expertise to fundamentally improve the way the world moves.</span></p>\n<p><span>Via was founded with the guiding principle that we go further when we go together. We are dedicated to building a diverse, inclusive and authentic workplace. If you’re excited about this role but your past experience doesn’t align perfectly with every qualification in the job description, we encourage you to apply anyways. You may be just the right candidate for this or other roles. All backgrounds, identities, and voices are welcomed and celebrated at Via.</span></p>\n<p><span>Ready to join the ride? </span></p>\n<p><em><span>Via is an equal opportunity employer.</span></em></p>\n<p><em><span><span>#LI-RB1  </span></span></em></p>\n</div>',
