        text: 'Explain your reasoning here \n \n```python \n\ndef countDistinctCategories(categories: List[int]) -> int:\n    res = 0\n    n = len(categories)\n    \n    for i in range(n):\n        count = {}\n        for j in range(i, n):\n            count[categories[j]] = count.get(categories[j], 0) + 1\n            res += len(count)\n    \n    return res\n\n```',
